  $templateCache.put('/static/partials/upload-audio.html', "<div ng-controller=\"AudioUploadCtrl\">\n  <div class=\"container-fluid\">\n    <div class=\"row\">\n      <div class=\"col-md-12\">\n        <h2>Upload New Audio File</h2>\n      </div>\n    </div>\n    <div class=\"row\">\n      <div class=\"well well-lg\">\n        <form novalidate name=\"audioUploadForm\">\n          <div class=\"form-group\">\n            <label>File Name</label>\n            <input name=\"audioName\" ng-model=\"audio.name\" type=\"text\" class=\"form-control\" required>\n          </div>\n          <div class=\"form-group\">\n            <label>Tags</label>\n            <textarea ng-model=\"audio.tags\" class=\"form-control\" rows=\"5\"></textarea>\n          </div>\n          <div class=\"form-group\">\n            <label>Audio File</label>\n            <input name=\"audioFile\" ng-model=\"audio.file\" type=\"file\" nv-file-select=\"\" uploader=\"uploader\" ng-hide=\"uploader.queue.length >0\" />\n            <div ng-hide=\"uploading\" ng-if=\"uploader.queue[0]\" class=\"alert alert-info\" role=\"alert\">{{ uploader.queue[0].file.name }} <button type=\"button\" class=\"close\" data-dismiss=\"alert\" aria-label=\"Close\"><span aria-hidden=\"true\" ng-click=\"uploader.queue[0].remove(); \">&times;</span></button></div>\n          </div>\n          <div class=\"progress\" style=\"\" ng-show=\"uploading\">\n            <div class=\"progress-bar\" role=\"progressbar\" ng-style=\"{ 'width': uploader.progress + '%' }\">Uploading {{ uploader.queue[0].file.name }} ({{uploader.progress}}%)</div>\n          </div>\n          <div class=\"clearfix\">\n            <div class=\"form-group pull-right\">\n              <button class=\"btn btn-default\">Cancel</button>\n              <button class=\"btn btn-default\" ng-click=\"submit(audio)\">submit</button>\n            </div>\n          </div>\n        </form>\n      </div>\n    </div>\n  </div>\n</div>\n");
